import React, { useState } from 'react';

const Counter = () => {
  const [count, setCount] = useState(0);
  const [control, setControl] = useState([0, 1, 2]);


  const counterHandle = (type) => {
    if (type === 'addCount'){
       setCount(...count,[0])
      
    }

    if (type === 'removeAll'){
      setCount([0])
    }

    if (type === 'removeCard'){
      
    }
  }



