    if (type === "increment") {

      

      setCount(count + 1)
    }

    if (type === "decrement") {

      setCount(count - 1)

    }

    if (type === "reset") {
      setCount(0)
    }

    if (type === "maxIncrement") {
      count < 10 && setCount(count + 1)
    }

 

    if (type === "maxDecrement") {
      count > -10 && setCount(count - 1)
    }



  }


  
  
  



