    <div>
      {
        control.map((item,idx)=>{

    <div className="container">
      <div className="row my-3">
        <div className="col-md-4">
          <div className="card">
            <div className="card-header text-center">
              <span className='fs-3'>{count}</span> 
              <button className='btn text-danger float-end fs-3'
              onClick={() => counterHandle('removeCard')}
              >x</button>
              
            </div>
            <div className="card-body text-center">
              <button
                className='btn btn-info'
                onClick={() => handleChange("increment")}
                type="button"
              >
                +
              </button>
              
              <button
                className='btn btn-dark mx-3'
                onClick={() => handleChange("reset")}
                type="button"
              >
                Reset
              </button>
              <button
                className='btn btn-danger'
                onClick={() => handleChange("decrement")}
                type="button"
              >
                -
              </button>

            </div>
            <div className='text-center'>
              <button className='btn btn-info m-3'
                onClick={() => handleChange("maxIncrement")}
                type='button'
              >
                Max Increment
              </button>

              <button className='btn btn-danger m-3'
                onClick={() => handleChange("maxDecrement")}
                type='button'
              >
                Max Decrement
              </button>

            </div>
          </div>
        </div>
      </div>

      
      
    </div>
